  BIANNUALLY<br /></div><div><br /></div><div>DATA LAST UPLOADED TO THIS SITE: 2016-10-01</div><div><br
  /></div><div><a href=\"https://logis.loudoun.gov/metadata/Stormwater%20structures.html\"
  target=\"_blank\">More Metadata</a><br /></div><p>Loudoun County u2013 Storm Water
  Infrastructure</p><p>The stormwater data is comprised of arcs/lines (pipes and culverts)
  and points (inlets, manholes, pipe ends, ponds and control devices). The pipes and
  culverts are the man-made structures composed of concrete, metal and plastic used
  to convey stormwater from catch basins and ponds to the natural drainage ways and
  swales that eventually discharge to creeks and streams. The point structures, typically
  one at the end of each line, include the stormwater infrastructure where there is
  a change in pipe direction. The data are collected primarily in eastern Loudoun
  in the more urbanized portions of the County. The data were collected in the field
  using GPS so that at least 95% of data is accurate to less than 1 meter.</p>\",\n\t\"license_title\":
